import React from "react";
import { Container, Navbar, NavbarBrand } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMoon } from "@fortawesome/free-solid-svg-icons";
import styled from "styled-components";

const AppNavbar = () => {
  return (
    <NavBarWrappper>
      <Container className="py-2 px-4">
        <NavbarBrand>
          <h1 className="fs-5 mb-0 title fw-bold">Where in the world?</h1>
        </NavbarBrand>

        <button className="text-capitalize fs-6">
          {" "}
          <FontAwesomeIcon icon={faMoon} className="me-2" />
          dark mode
        </button>
      </Container>
    </NavBarWrappper>
  );
};

const NavBarWrappper = styled(Navbar)`
  background-color: var(--darkModeTextAndLightModeElements);
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
  .dark-mode-option {
    cursor: pointer;
  }
`;
export default AppNavbar;
